import React, { Component } from 'react';
import "../../MainBody.css"

class Origami extends Component {

    render() {
        if (this.props.visible)
        {
            return (
                <div className="comment">
                    <h2>Андрей Зайцев</h2>
                    <span className="comment-content">Клевая пися козла
                    Да-да
                    Очень клевая
                    Так бы и коснулся</span>
                </div>
            );
        }
        else return null;
    }
}

export default Origami;
